.tab-bar {
  height: 46px;
  background: #19241b;
  box-shadow: none;
  box-sizing: border-box;
}
.tab-bar:after {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0px;
  width: 100%;
  background-color: #151e16;
  border-bottom: 1px solid #2f7e25;
}
.tab-bar .tab {
  position: relative;
  top: 0px;
  height: 46px;
  line-height: 40px;
  color: #637d75;
  border-right: 1px solid #2f7e25;
  font-size: 12px;
  border-top: 6px solid #2f7e25;
}
.tab-bar .tab,
.tab-bar .tab:before {
  background-color: #151e16;
}
.tab-bar .tab:before {
  content: "";
  position: absolute;
  line-height: 40px;
  width: 0px;
}
.tab-bar .tab .close-icon {
  top: 0;
}
.tab-bar .tab .close-icon:hover:before {
  color: #73f990;
}
.tab-bar .tab .title {
  padding-left: 5px;
  position: relative;
}
.tab-bar .tab:first-child {
  padding-left: 10px;
}
.tab-bar .tab.active {
  line-height: 40px;
  color: #98aea7;
}
.tab-bar .tab.active,
.tab-bar .tab.active:before {
  background-color: #242d2a;
  height: 46px;
}
.tab-bar .tab.active .title {
  padding-left: 5px;
  position: relative;
}
.tab-bar .tab.active:hover,
.tab-bar .tab:hover {
  background-color: #1d4125;
  color: #98aea7;
}
.tab-bar .tab.modified,
.tab-bar .tab.modified:not(:hover) {
  color: #707f23;
}
.tab-bar .tab.modified .close-icon,
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 0;
  right: 10px;
  width: 12px;
  height: 12px;
  border: none;
}
.tab-bar .tab.modified .close-icon:before,
.tab-bar .tab.modified:not(:hover) .close-icon:before {
  color: #707f23;
  content: "\f052";
}
.tab-bar .tab.modified .close-icon:hover:before,
.tab-bar .tab.modified:not(:hover) .close-icon:hover:before {
  color: #73f990;
  content: "\f081";
}
.tab-bar .placeholder {
  height: 46px;
}
.tab-bar .placeholder:after {
  top: 46px;
}
